import { StyleSheet, TextInput, View } from "react-native";

import {
  UserIcon,
  ChevronDownIcon,
  SearchIcon,
  AdjustmentIcon,
  MagnifyingGlassIcon,
} from "react-native-heroicons/outline";

const SearchComponent = () => {
  return (
    <View>
      <AdjustmentIcon />
    </View>
  );
};

const styles = StyleSheet.create({
  search: {
    flexDirection: "row",
    marginStart: 16,
    marginEnd: 16,
    padding: 8,
    alignItems: "center",
    backgroundColor: "lightgray",
  },
});

export default SearchComponent;
